import React, { useState, useEffect } from 'react';
import styled, { keyframes } from 'styled-components';

// Animations
const fadeInDown = keyframes`
  from {
    opacity: 0;
    transform: translateY(-30px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const pulse = keyframes`
  0%, 100% { transform: scale(1); }
  50% { transform: scale(1.05); }
`;

const HeaderContainer = styled.header`
  position: relative;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  padding: 2rem 0;
  text-align: center;
  overflow: hidden;
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: url('data:image/svg+xml,<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 100"><defs><pattern id="dots" width="20" height="20" patternUnits="userSpaceOnUse"><circle cx="10" cy="10" r="1.5" fill="rgba(255,255,255,0.1)"/></pattern></defs><rect width="100" height="100" fill="url(%23dots)"/></svg>');
  }
  
  &::after {
    content: '';
    position: absolute;
    top: -50%;
    left: -50%;
    width: 200%;
    height: 200%;
    background: radial-gradient(circle, rgba(255, 255, 255, 0.1) 0%, transparent 70%);
    animation: ${pulse} 4s ease-in-out infinite;
  }
`;

const HeaderContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
  position: relative;
  z-index: 1;
  animation: ${fadeInDown} 1s ease-out;
`;

const MainTitle = styled.h1`
  font-size: 3.5rem;
  font-weight: 800;
  margin-bottom: 1rem;
  background: linear-gradient(45deg, #ffeaa7, #fab1a0, #fd79a8);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.3);
  letter-spacing: -1px;
  
  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
  
  @media (max-width: 480px) {
    font-size: 2rem;
  }
`;

const Subtitle = styled.p`
  font-size: 1.3rem;
  color: rgba(255, 255, 255, 0.9);
  margin-bottom: 2rem;
  max-width: 600px;
  margin-left: auto;
  margin-right: auto;
  line-height: 1.6;
  
  @media (max-width: 768px) {
    font-size: 1.1rem;
  }
`;

const FeatureList = styled.div`
  display: flex;
  justify-content: center;
  gap: 2rem;
  flex-wrap: wrap;
  margin-top: 2rem;
`;

const FeatureItem = styled.div`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  background: rgba(255, 255, 255, 0.1);
  padding: 0.8rem 1.5rem;
  border-radius: 25px;
  backdrop-filter: blur(10px);
  border: 1px solid rgba(255, 255, 255, 0.2);
  color: white;
  font-size: 0.9rem;
  font-weight: 500;
  transition: all 0.3s ease;
  
  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 5px 15px rgba(0, 0, 0, 0.2);
    border-color: rgba(255, 234, 167, 0.5);
  }
`;

const HeaderStats = styled.div`
  display: flex;
  justify-content: center;
  gap: 3rem;
  margin-top: 3rem;
  
  @media (max-width: 768px) {
    gap: 2rem;
  }
  
  @media (max-width: 480px) {
    flex-direction: column;
    align-items: center;
    gap: 1rem;
  }
`;

const StatItem = styled.div`
  text-align: center;
  color: white;
  
  .stat-number {
    font-size: 2rem;
    font-weight: bold;
    background: linear-gradient(45deg, #74b9ff, #0984e3);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    background-clip: text;
    margin-bottom: 0.5rem;
  }
  
  .stat-label {
    font-size: 0.9rem;
    opacity: 0.8;
  }
`;

const Header = ({ onGetStarted }) => {
  const [stats, setStats] = useState({
    analyses: 0,
    users: 0,
    accuracy: 0
  });

  useEffect(() => {
    // Animate counters
    const targetStats = { analyses: 50000, users: 10000, accuracy: 98 };
    const duration = 2000;
    const steps = 60;
    const increment = {
      analyses: targetStats.analyses / steps,
      users: targetStats.users / steps,
      accuracy: targetStats.accuracy / steps
    };

    let currentStep = 0;
    const interval = setInterval(() => {
      if (currentStep < steps) {
        setStats(prev => ({
          analyses: Math.min(Math.round(prev.analyses + increment.analyses), targetStats.analyses),
          users: Math.min(Math.round(prev.users + increment.users), targetStats.users),
          accuracy: Math.min(Math.round(prev.accuracy + increment.accuracy), targetStats.accuracy)
        }));
        currentStep++;
      } else {
        clearInterval(interval);
      }
    }, duration / steps);

    return () => clearInterval(interval);
  }, []);

  const features = [
    { icon: 'ü§ñ', text: 'AI-Powered Analysis' },
    { icon: '‚ö°', text: 'Real-time Feedback' },
    { icon: 'üìä', text: 'Detailed Reports' },
    { icon: 'üéØ', text: '98% Accuracy' }
  ];

  return (
    <HeaderContainer>
      <HeaderContent>
        <MainTitle>üèÉ‚Äç‚ôÇÔ∏è AlignIQ</MainTitle>
        <Subtitle>
          Revolutionary AI-powered posture analysis platform that helps you achieve perfect form, 
          prevent injuries, and optimize your health through intelligent movement analysis.
        </Subtitle>
        
        <FeatureList>
          {features.map((feature, index) => (
            <FeatureItem key={index}>
              <span>{feature.icon}</span>
              <span>{feature.text}</span>
            </FeatureItem>
          ))}
        </FeatureList>

        <HeaderStats>
          <StatItem>
            <div className="stat-number">{stats.analyses.toLocaleString()}+</div>
            <div className="stat-label">Analyses Completed</div>
          </StatItem>
          <StatItem>
            <div className="stat-number">{stats.users.toLocaleString()}+</div>
            <div className="stat-label">Happy Users</div>
          </StatItem>
          <StatItem>
            <div className="stat-number">{stats.accuracy}%</div>
            <div className="stat-label">Accuracy Rate</div>
          </StatItem>
        </HeaderStats>
      </HeaderContent>
    </HeaderContainer>
  );
};

export default Header;
